CREATE TABLE IF NOT EXISTS n2yo_satellite_position_data (
    `list_info_transactionscount` INT,
    `list_info_satname` VARCHAR(22) CHARACTER SET utf8,
    `list_info_satid` INT,
    `list_positions_elevation` NUMERIC(4, 2),
    `list_positions_satlongitude` NUMERIC(11, 8),
    `list_positions_timestamp` INT,
    `list_positions_satlatitude` NUMERIC(10, 8),
    `list_positions_ra` NUMERIC(11, 8),
    `list_positions_azimuth` NUMERIC(5, 2),
    `list_positions_dec` NUMERIC(10, 8),
    `list_positions_sataltitude` NUMERIC(6, 2)
);
